description:
Инверторный сварочный полуавтомат Aurora PRO OVERMAN 180 Mosfet 10041 прекрасно подходит для работы как на бытовом, так и на профессиональном уровне благодаря продолжительному режиму работы на максимальных токах. В гараже, в автосервисе, на производстве - везде OVERMAN 180 будет проявлять себя прекрасным и надежным помощником в любом деле. Нагляное управление всеми важными параметрами сварки на лицевой панели позволит настроить полуавтомат для выполнения широкого спектра сварочных работ.
В комплект входит: 

Горелка MIG-15, 3 м;
Кабель 25 мм2, 3 м;
Зажим на массу 300 А;
Газовый шланг (с комплектом хомутов) 3 м (9 мм);
Упаковка.

Комбинированный лазерный нивелир Bosch GCL 2-50 + RM1 + BM3 + LR6 + кейс используются при проведении ремонтных и строительных работ.
Комплектация:
Лазерный нивелир;
Держатель RM1;
Лазерный приемник LR 6;
Держатель приемника;
Потолочный зажим BM3;
3 батареи 1,5 В LR6 (тип AA);
2 батареи 1,5 В LR3 (тип AАA);
Лазерная мишень;
Кейс.
